      letting_fees:
        '<h3 class="listing-desc-header top"><strong><br></strong></h3><br><u>Summary of fees charged for lettings</u><br><br>Tenant administration fees are as set out in the Application form. For all tenancies exchanged prior to 1st June 2019 these fees will remain in place until 1st June 2020. Please refer to the application form signed prior to 1st June 2019 for the detail of these fees. All tenancies exchanged from 1st June 2019 will be in line with tenant fee ban legislation and the charges detailed below.<br><br><b>Once your offer on a property is agreed, your application is subject to:</b><br><br><ul> <li>Commitment To Rent Agreement <ul> <li> The Tenant will be liable to pay an amount equal to 1 weeks rent in the event that the tenancy fails to progress for due to an event occurring as set out in the Application Form which details the terms of the Commitment To Rent Agreement </li> </ul> </li> <li>Refundable Holding deposit <ul> <li> A Landlord may require a payment of up to 1 weeks rent, instead of the Commitment to Rent Agreement terms. Cgeal will not be party to any payment arrangements or terms associated with the payment. Tenants will deal directly with the Landlord on any payment arrangements and should not make payment to any cgeal named bank account for these monies. Tenants should ensure they are wholly satisfied that the Refundable Holding Deposit arrangements are in line with current regulations before making any payment </li> </ul> </li> </ul><br><br><b>Fees when you vacate</b><br><br><ul> <li>Early termination (where agreed with the landlord) <ul> <li>The outstanding rent payable to the landlord under the tenancy;</li> <li>£50.00 inc. VAT for the reasonable costs of us carrying out the Early Termination;</li> <li> £19.98 inc. VAT towards the landlord\'s administration costs of registering the deposit with the TDS (Tenancy Deposit Scheme) should the landlord be registered with this scheme. </li> </ul> </li> <li>Administration fees for tenancy swap <ul> <li>£50.00 inc. VAT on each occurrence</li> </ul> </li> </ul><br><br><b>Tenant Protection</b><br><br>The Chancellors Group of Estate Agents Ltd (\'cgeal\') is a member of the Tenancy Deposit Scheme - an approved scheme. Chancellors is proud to be a member of Property Redress Scheme. Cgeal is a member of the Propertymark Client Money Protection Scheme.<br><h3 class="listing-desc-header top"><strong><br></strong></h3>',
