        "Tenant Fees Schedule - New Assured Shorthold Tenancies (ASTs) signed on or after 1st June 2019<br>Holding Deposit - 1 weeks' rent (per tenancy)<br>This is to reserve the property. This will be withheld if any relevant person (including guarantors(s)) withdraws from the tenancy, fails a Right to Rent check, provides materially significant false or misleading information, or fails to sign their tenancy agreement within 15 calendar days (or other Deadline for Agreement as mutually agreed in writing).<br>Security Deposit - 5 weeks' rent (per tenancy)<br>This is 6 weeks' rent for tenancies where the annual rent is £50,000 or higher. This covers damages or defaults on the part of the tenant during the tenancy.<br>Unpaid rent<br>Interest at 3% above the Bank of England Base Rate from Rent Due Date until paid in order to pursue non-payment of rent. Please Note: This will not be levied until the rent is more than 14 days in arrears.<br>Lost key(s) or other Security Device(s)<br>Tenants are liable to the actual cost of replacing any lost key(s) or other security device(s). If the loss results in locks needing to be changed, the actual costs of a locksmith, new lock and replacement keys for the tenant, landlord any other persons requiring keys will be charged to the tenant. If extra costs are incurred there will be a charge of £15 per hour (inc. VAT) for the time taken replacing lost key(s) or other security device(s).<br>Variation of Contract at the Tenant's request<br>£50 (inc. VAT) per agreed variation.<br>Change of Sharer at Tenant's request<br>£50 (inc. VAT) per replacement tenant or any reasonable costs incurred if higher.<br>Surrender (early termination) at Tenant's request<br>Should the tenant wish to leave their contract early, they accept responsibility for the associated costs and compensation for terminating the tenancy early, such costs and compensation not to exceed the loss experienced by the Landlord for agreeing to this request. These costs and compensation will be equal to one month of rent plus VAT unless this sum is greater than the loss experienced by the Landlord, in which case the Tenant will be advised of the relevant amount by the Agent. This amount is payable in full to the Agent when you confirm your intention to surrender your tenancy. This payment is non-refundable. For the avoidance of doubt, should the tenant look to surrender their tenancy early they will remain responsible for all obligations under the tenancy agreement, including rent, until the commencement of a replacement tenancy.<br>If you enter into a Non-ast payments which may apply will be as follows:<br>Application Fee - £660 per tenancy<br>Deposit - 6 weeks' rent for unfurnished properties (2 months' rent for furnished properties or where there is a pet)<br>Deposit Registration with TDS - £10.20<br>Guarantor Fee - £90<br>Renewal Fee - £95<br>Change of Sharer Fee* - £240 for outgoing sharer and £120 for new replacement sharer<br><br>Finders Keepers is a member of The Property Ombudsman, an independent redress scheme, and also a member of ARLA Propertymark. Client Money Protection is provided by the ARLA Propertymark Client Money Protection Scheme.",
