      letting_fees:
        '<h3 class="listing-desc-header top"><strong><br></strong></h3><br>Acceptance of any offer will be subject to contract, referencing and immigration checks. You will need to pay the Rent and Deposit that is due under a Tenancy Agreement, or where the landlord is offering the property with a deposit replacement guarantee product, and you wish to take up this option, you will need to provide proof that you have purchased such a product by providing us with a copy of the insurance certificate before a tenancy can start.<br><br><strong>Referencing and Right to Rent Checks</strong> - You will be asked to complete an application form before referencing can be undertaken, you should also provide an original photographic Identification (e.g. Passport, National id card, visa, resident permit, driving licence) and Proof of Residence (e.g. Original utility bill, council tax bill or bank statement all of which much be less than 3 months old). The need for a guarantor may not become apparent until your referencing (including references for any joint tenants) has been completed. Where a guarantor is required an application form and photographic identification with proof of residence will be required.<br><br>Referencing will cover a check against the credit file and public records of the individual, an Anti-Money Laundering check, confirmation of employment and salary details, confirmation of previous tenancy details, right to rent checks, reporting the results of all those checks to your prospective landlord to see if your application is acceptable.<br><br>Tenant deposit - In England under the Tenant Fees Act 2019 Deposits are limited to the equivalent of 5 weeks rent for new and renewed tenancies (or 6 weeks if the annual rent is £50,000 or more). This is calculated by dividing the annual rent by 52 and multiplying by 5 (or 6 if rent is £50,000 or more) and will be required to be paid at the start of the tenancy. This is subject to referencing.<br><br>Holding deposit - In England under the Tenant Fees Act 2019 Holding Deposits are limited to the equivalent of one weeks rent. This is paid in order to reserve a property. This is calculated by multiplying the monthly rent by 12 to establish the annual rent, then dividing the annual rent by 52. The Holding Deposit will be required to be paid once your offer is accepted. You will be provided with the rules of when this is to be returned to you or retained by the agent before this payment is made.<br><br><strong>Tenant Fees Act 2019</strong> permits certain fees / charges to be made under the following circumstances:<br><br><strong>Company application fee</strong> - £100.00<br>£100 including VAT<br><br><strong>Default fee for late payment of rent</strong><br>Chargeable from 14 days arrears calculated on the interest at 3% above Bank of England base rate on the late payment of rent for each day that the payment is outstanding.<br><br><strong>Loss of a key or other security device</strong><br>Landlords and letting agents can charge a tenant a fee to cover the cost of replacing the lost key or security device (e.g. Fob, electronic device for garage doors / security gates).<br><br><strong>Payment on termination of a tenancy</strong><br>Landlords and letting agents can require a tenant to make a payment for an early termination (surrender) of the tenancy agreement at the tenant\'s request.<br><br><strong>Payment on variation, assignment or novation of a tenancy</strong> - £50.00<br>When a tenant has requested it, landlords and letting agents can charge to vary, assign or replace a tenancy. Fee charge £50 (including VAT).<br><br>Should you require further clarification, please ask us to explain these to you.<br><br>We are members of:<br><br>The Property Ombudsman Redress Scheme - C0008<br><br>ARLA/Propertymark Client Money Protection Scheme - C0002080<br><h3 class="listing-desc-header top"><strong><br></strong></h3>',
